import React from 'react';
import './SellerDashboard.css'; // Import seller dashboard CSS

const SellerDashboard = () => {
  return (
    <div className="dashboard-container">
      <h1>Seller Dashboard</h1>
      <h2>Manage Products</h2>
      <button>Add New Product</button>
      <ul className="product-list">
        <li>Product 1 <button>Edit</button> <button>Delete</button></li>
        <li>Product 2 <button>Edit</button> <button>Delete</button></li>
        {/* More products */}
      </ul>
      <h2>Orders</h2>
      {/* List orders */}
    </div>
  );
};

export default SellerDashboard;
